import { useContext } from "react"
import { DataContextApi } from "../store/datacontext"
export default function ProductLIst(){
const {products}=useContext(DataContextApi)
    return(
        <div>
           {
            products.map((ele)=>{
                return<li style={"none"} key={ele._id}>{ele.name}</li>
            })
           }
        </div>
    )
}
